// @flow
import * as React from "react";
import Header from "grommet/components/Header";
import Heading from "grommet/components/Heading";
import Box from "grommet/components/Box";
import Section from "grommet/components/Section";
import Paragraph from "grommet/components/Paragraph";
import Button from "grommet/components/Button";

import MeasurementModel from "../../models/Measurement";
import ReadingModel from "../../models/Reading";
import FluxHeatmap from "../../containers/fluxHeatmap/FluxHeatmap";

type Props = {
	currentMeasurement: MeasurementModel,
	onStartMeasurement: () => void,
	readings: ?(ReadingModel[])
};

export default function MeasurementSummary({
	currentMeasurement,
	onStartMeasurement,
	readings
}: Props) {
	return (
		<Section>
			<Header size="small">
				<Heading tag="h3">Aktuelle Messung</Heading>
			</Header>
			<Box>
				<Header size="small">
					<Heading tag="h3">Grundriss</Heading>
				</Header>
				{readings && (
					<div
						style={{
							width: "100%",
							maxWidth: 800,
							margin: "auto"
						}}
					>
						<FluxHeatmap
							readings={readings}
							backgroundImage={
								"data:image/png;base64,"
							}
							transformation={{
								xOffset: 405,
								yOffset: 30,
								scaleFactor: 0.039,
								targetWidth: 800
							}}
							configObject={{
								radius: 10,
								maxOpacity: 0.5,
								minOpacity: 0,
								blur: 0.75
							}}
						/>
					</div>
				)}
			</Box>
			<Box>
				<Paragraph>Messung ID: {currentMeasurement.measurementId}</Paragraph>
				{readings && <Paragraph>Anzahl Messungen: {readings.length}</Paragraph>}
			</Box>
			<Button label="Start/Stopp" onClick={onStartMeasurement} />
		</Section>
	);
}
